(function ($, window, document, undefined) {
    var TextSelector = function (opts) {
        this.default = {
            defaultData: {},
            confirm: function () {
                return null;
            },
            title: '文字选择',
            //  是否可通过点击遮罩关闭
            closeOnClickMask: true,
            //  是否可通过按下 ESC 键关闭 x
            closeOnPressEscape: true,
            //  打开时是否锁定滚动条 x
            lockScroll: true,
            //  关闭之前的回调，返回false则不关闭。x
            beforeClose: null,
            //  关闭之后的回调 x
            afterClose: null
        };
        this.options = $.extend({}, this.default, opts);
    };
    
    TextSelector.prototype = {
        init: function () {
            this.__DOM__createAppEle()
                .__DOM__createLinkEle()
                .bindEvents();
            this.$element = $('#__GSR__');
            this.$container = this.$element.find('.__GSR__inner');
            //将内容，类型渲染到页面中
            this.$container.find('textarea').text(this.options.defaultData.content);
            this.$container.find('input').val(this.options.defaultData.op_value);
            this.$container.find('select').val(this.options.defaultData.op_type);
            return this;
        },


        /*  事件处理
         ============================================================================ */
        //打开弹窗
        
        open: function () {
            if (!this.isDialog) return;
            var _this = this;
            this.$mask.addClass('show');
            this.$element.addClass('show');
            setTimeout(function () {
                _this.$mask.addClass('open');
                _this.$element.addClass('open');
            });
        },
        //关闭弹窗
        close: function () {
            if (!this.isDialog) return;
            var _beforeClose = this.options.beforeClose,
                _afterClose = this.options.afterClose;
            if (typeof (_beforeClose) === 'function' && _beforeClose() === false) return;
            var _this = this;
            this.$mask.removeClass('open');
            this.$element.removeClass('open');
            setTimeout(function () {
                _this.$mask.remove();
                _this.$element.remove();
            }, 350);
            typeof (_afterClose) === 'function' && _afterClose();
        },
        bindEvents: function () {
            var _this = this;
            //  点击遮罩关闭
            this.options.closeOnClickMask &&
                this.$mask.on('click', function () {
                    _this.close();
                });
            //  点击关闭按钮关闭
            this.$container.on('click', '.__GSR__close', function () {
                _this.close();
            });
            //  点击确认，回调
            this.$container.on('click', '.confirm', function () {
                _this.__FUN__confirm();
                //_this.close();
            });
            //  点击取消，关闭
            this.$container.on('click', '.cancel', function () {
                _this.close();
            });

            //  点击其它地方收起分类菜单
            $(document).on('click', function (event) {
                _this.$element.find('.__GSR__select-box').removeClass('show');
                _this.$element.find('.__GSR__search-item-select-button').removeClass('active');
            });
            return this;
        },

        //  确认回调
        __FUN__confirm: function () {
            var _this = this;
            var _confirm = _this.options.confirm;
            this.$element = $('#__GSR__');
            this.$container = this.$element.find('.__GSR__inner');
            var selector_textarea = this.$container.find('textarea').val();
            var selector_input = this.$container.find('input').val();
            var selector_select = this.$container.find('select').val();
            var textObj = {
                content: selector_textarea,
                op_type: selector_select,
                op_value: selector_input
            }
            _confirm(textObj);
            _this.close();
        },
        //        弹窗中的html
        __DOM__createAppEle: function () {
            var _ele = '\
                <div id="__GSR__">\
                    <div class="__GSR__controller">\
                        <div class="__GSR__inner">\
                            <div class="__GSR__title">\
                                <h2>' + this.options.title + '</h2>\
                                <i class="__GSR__close"></i>\
                            </div>\
                            <div class="__GSR__body">\
	                            <div class="text-selector-content">\
	                                <div class="text-selector-textarea">\
		                                <span>文字:</span>\
		                                    <textarea name="content" value="content" placeholder="请在文本区域输入文字，长度不少于20个字"></textarea>\
		                             </div>\
		                             <div class="text-selector-type-select">\
		                             <span>类型选择:</span>\
	                                    <select name="op_type" value="op_type">\
	                                      <option value="" selected>请选择</option>\
	                                      <option value="none">无操作</option>\
			                              <option value="link">连接地址</option>\
	                                      <option value="keyword">关键字</option>\
	                                      <option value="goods-sn">商品编号</option>\
                                         <option value="goods-cat">商品分类</option>\
                                    </select>    \
                                    <input type="text" value="" name="op_value" style="width:225px">\
		                            </div>\
		                        </div>\
                            </div>\
                            <div class="__GSR__footer">\
                                <button class="confirm" type="button">保存</button>\
                                <button class="cancel" type="button">取消</button>\
                            </div>\
                        </div>\
                    </div>\
                </div>\
                <div id="__GSR__mask"></div>';
            $(_ele).appendTo($('body'));
            this.$element = $('#__GSR__');
            this.isDialog=this.$element ;
            this.$mask = $("#__GSR__mask");
            this.$container = this.$element.find('.__GSR__inner');
            return this;
        },
        __DOM__createLinkEle: function () {
            $('#textSelectorCss').length === 0 && (function () {
                var styleEle = document.createElement('link');
                styleEle.id = 'textSelectorCss';
                styleEle.type = 'text/css';
                styleEle.rel = 'stylesheet';
                styleEle.href = ctx + '/selector/css/jquery.textselector.css';
                document.head.appendChild(styleEle);
            })();
            return this;
        },
    };


    $.TextSelector = function (options) {
        var textSelector = new TextSelector(options);
        textSelector.init().open();
        return textSelector;
    };

})(jQuery, window, document);
var __GSR__loading_img = 'data:image/gif;base64,';